import{_ as e,o as t,c as r,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 8.9A-709 Priority.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.9A-709.md","filePath":"vacode/8.9A-709.md"}'),a={name:"vacode/8.9A-709.md"},o=i('<h1 id="§-8-9a-709-priority" tabindex="-1">§ 8.9A-709 Priority. <a class="header-anchor" href="#§-8-9a-709-priority" aria-label="Permalink to &quot;§ 8.9A-709 Priority.&quot;">​</a></h1><p>(a) Law governing priority. This title determines the priority of conflicting claims to collateral. However, if the relative priorities of the claims were established before this title takes effect, former Title 8.9 determines priority.</p><p>(b) Priority if security interest becomes enforceable under § <a href="http://law.lis.virginia.gov/vacode/8.9A-203/" target="_blank" rel="noreferrer">8.9A-203</a>. For purposes of § <a href="http://law.lis.virginia.gov/vacode/8.9A-322/" target="_blank" rel="noreferrer">8.9A-322</a> (a), the priority of a security interest that becomes enforceable under § <a href="http://law.lis.virginia.gov/vacode/8.9A-203/" target="_blank" rel="noreferrer">8.9A-203</a> dates from the time this title takes effect if the security interest is perfected under this title by the filing of a financing statement before this title takes effect which would not have been effective to perfect the security interest under former Title 8.9. This subsection does not apply to conflicting security interests each of which is perfected by the filing of such a financing statement.2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP1007" target="_blank" rel="noreferrer">1007</a>.</p>',3),n=[o];function s(c,f,l,h,d,p){return t(),r("div",null,n)}const m=e(a,[["render",s]]);export{g as __pageData,m as default};
